#
# TABLE STRUCTURE FOR: channels
#

DROP TABLE IF EXISTS `channels`;

CREATE TABLE `channels` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(250) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название канала',
  `services_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на сервисуслугу',
  `status_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на таблицу статусов для канала',
  `to_location_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на локацию, куда идет канал',
  `from_location_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на локацию, откуда идет канал',
  `provider_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на провайдера',
  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание канала',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Статус оборудования (выведен из эксплуатации, в работе, в резерве и т.п)';



#
# TABLE STRUCTURE FOR: devise_model
#

DROP TABLE IF EXISTS `devise_model`;

CREATE TABLE `devise_model` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Модель устройства',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Локации, местоположение';



#
# TABLE STRUCTURE FOR: devise_type
#

DROP TABLE IF EXISTS `devise_type`;

CREATE TABLE `devise_type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Тип устройства',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Локации, местоположение';



#
# TABLE STRUCTURE FOR: devises
#

DROP TABLE IF EXISTS `devises`;

CREATE TABLE `devises` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `devise_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя устройства',
  `ipv4` int(10) unsigned DEFAULT NULL COMMENT 'ipv4 в виде целого числа, ',
  `location_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на локацию, где размещено устройство',
  `services_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на сервисуслугу устройства (сервис который обсесечивается устройством - почта, бд, лвс, 1С и т.п )',
  `devise_type_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на тип устройства',
  `devise_model_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на модель устройства',
  `organisation_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на организацию владельца',
  `status_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на таблицу статусов для устройства',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание, комментарии для устройства',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `devise_name` (`devise_name`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Устройства';



#
# TABLE STRUCTURE FOR: location
#

DROP TABLE IF EXISTS `location`;

CREATE TABLE `location` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `location_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название локации',
  PRIMARY KEY (`id`),
  UNIQUE KEY `location_name` (`location_name`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Локации, местоположение';



#
# TABLE STRUCTURE FOR: organisation
#

DROP TABLE IF EXISTS `organisation`;

CREATE TABLE `organisation` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(150) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название организации',
  `description` text COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Описание организации',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта организации',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон организации',
  `contact_user_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на пользователя - контактное лицо ',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Организация';



#
# TABLE STRUCTURE FOR: providers
#

DROP TABLE IF EXISTS `providers`;

CREATE TABLE `providers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название провайдера',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
